  return (
    <div className=" bg-red-500 flex justify-start flex-shrink-0 flex-no-wrap flex-col flex-grow max-w-full min-h-screen overflow-visible w-full h-screen bg-lightpink p-20">
      <div className="relative w-full flex-grow-0 flex-shrink-0 overflow-hidden">
        <canvas className="opacity-100 fade">hero</canvas>
      </div>

      <style jsx>{`
        @keyframes fadeIn {
          opacity: 0;
          animation-name: fadein;

          animation-delay: 2000ms;
          animation-duration: 500ms;
          animation-timing-function: ease-out;
          animation-fill-mode: forwards;
        }
      `}</style>
    </div>
  );
};
